import React from 'react';
import {range, Vec2} from '../utility';
import Cell from './Cell';

type GridProps = {position: Vec2};

const Grid: React.FC<GridProps> = (props) => {
    return (
        <div>
            {range(0, 10).map((row) =>
                range(0, 10).map((col) => {
                    return (
                        <div style={{display: 'flex', flexWrap: 'nowrap'}}>
                            <Cell
                                fill={new Vec2(row, col).isEqual(
                                    new Vec2(
                                        props.position.row,
                                        props.position.col,
                                    ),
                                )}
                                position={new Vec2(row, col)}
                            />
                            {/*{col == 9 ? <br /> : null}*/}
                        </div>
                    );
                }),
            )}
        </div>
    );
};

export default Grid;
